  car_id: number;
  mark: string;
  category: string;
  price: number;
  transmission: string;
  status: string;
  image_path: any;
}  

const CarInfo = () => {
  const [car, setCar] = useState<Car[]>([]);

  const getCar = async () => {
    const that_id = getCarIdFromUrlParams();
    const data = await fetch_data("/car/","GET");
    setCar(data);
  };

  return (
      <Car
        Mark={car.Mark}
        Category={car.Category}
        Price={car.Price}
        Transmission={car.Transmission}
        Status={car.Status}
        ImagePath={car.ImagePath}
      />
  );
};
